import axios from "axios";

export default {
  getBook: function (book) {
    return axios.get(
        `https://www.googleapis.com/books/v1/volumes?q=${book}&key=AIzaSyCIglnekiUoDx7Q2-RDWK-O0Il2B2ehAQY`

    );
  }
};
